import React, { Component, Fragment } from "react";
import BasicList from "./basic/BasicList"
class List extends Component {

    state = { 
        listingdata: [
            {
                content: "Unlimited Vendors1",
            },
            {
                content: "Unlimited Vendors1",
            },
            {
                content: "Unlimited Vendors1",
            },
            {
                content: "Unlimited Vendors1",
            }
        ]
    }  

    render() {
        let list;
        if (this.props.type === 'basiclist') {
            list = <BasicList data={this.state.listingdata} />
            // list =  '<ul className="list-group list-unstyled text-muted  mb-2 text-left">'+this.state.listingdata.map(sdata => <BasicList data={sdata} key="1" />)+'</ul>';
        }else {
            list = <p>Cart type not given.</p>
        }

        return(
            <Fragment>

                    {list}

            </Fragment>
        );
    }
}
export default List;
